input[type="text"], input[type="password"], input[type="email"], select, textarea{
    border-radius:0;
    font-family:work sans, lato, tahoma;
    padding-left:5px; padding-top:2px;
    font-family: work sans, lato, tahoma;
    border:1px solid #cdcdcd;
}

input[type="text"]:focus {


    outline:0;
    background:#fff;
    border:1px solid #1d7c9e;
    background : linear-gradient( 180deg, #fff, #f3f3f3 ); 


}


input[type="email"]:focus {


    outline:0;
    background:#fff;
    border:1px solid #1d7c9e;
    background : linear-gradient( 180deg, #fff, #f3f3f3 ); 



}


input[type="password"]:focus {


    color:#5b5b5b;
    outline:0;
    background:#fff;
    border:1px solid #1d7c9e;
    background : linear-gradient( 180deg, #fff, #f3f3f3 ); 

}



textarea:focus {

    color:#5b5b5b;

    outline:0;
    background:#fff;
    border:1px solid #1d7c9e;
    box-shadow: #c6c6c6 0px 0px 0px ; 
    background : linear-gradient( 180deg, #fff, #f3f3f3 ); 


}


select {
 color:#000;



 outline:0;

}



select:focus {

 border:1px solid #1d7c9e;
}






input[type="submit"],input[type="button"] {
    font-family:work sans, lato, tahoma;display:inline;margin-left:3px;margin-top:5px;margin-bottom:5px;
    border:0px;display:inline;background-color:#3399ff;padding:4px 7px;-webkit-border-radius:0px;border-radius:0px;color:#fff;-webkit-appearance: none;

    color:#fff;
    background:#1d7c9e;
    outline:0;
    border:0;
    min-height:30px;




}

input[type="submit"]:hover {
    background:#1c6d8a;   
}



input[type="button"]:hover{
    background:#1f5b7d;   
}



.button {
    color:#fff;
    background:#1d7c9e;
    outline:0;
    border:0;
    height:30px;
    font-family: work sans, lato, tahoma;
}

.button:hover {
    background:#1c6d8a;   
    color:#fff;
}


.uploadButton {
    color:#fff;
    background:#1d7c9e;
    outline:0;
    border:0;
    height:70px;
    font-family: work sans, lato, tahoma;
}

.uploadButton:hover {
    background:#1c6d8a;   
    color:#fff;
    cursor:pointer;
}






body{

    padding-top: 50px;

    font-family:work sans, lato, tahoma!important;

    background:#f5f5f5;


}

.navbar{

    background: #1d7c9e;

    color:#fff;

}

/* link */

.navbar-default .navbar-nav > li > a {

    color: #fff;

}

.navbar-default .navbar-nav > li > a:hover,

.navbar-default .navbar-nav > li > a:focus {

    color: #bde0f4;

    background:#1a5475;

}

.navbar-default .navbar-nav > .active > a, 

.navbar-default .navbar-nav > .active > a:hover, 

.navbar-default .navbar-nav > .active > a:focus {

    color: #fff;

    background-color: #1e3143;

}

.navbar-default .navbar-nav > .open > a, 

.navbar-default .navbar-nav > .open > a:hover, 

.navbar-default .navbar-nav > .open > a:focus {

    color: #fff;

    background-color: #134a6a;

}


.dropdown-menu li > a:hover, .dropdown-menu li > a:focus, .dropdown-submenu:hover > a{

    background:#1d7c9e;
    color:#fff;
}


/* caret */

.navbar-default .navbar-nav > .dropdown > a .caret {

    border-top-color: #fff;

    border-bottom-color: #fff;

}

.navbar-default .navbar-nav > .dropdown > a:hover .caret,

.navbar-default .navbar-nav > .dropdown > a:focus .caret {

    border-top-color: #fff;

    border-bottom-color: #fff;

}


.navbar-default .navbar-nav > .open > a .caret, 

.navbar-default .navbar-nav > .open > a:hover .caret, 

.navbar-default .navbar-nav > .open > a:focus .caret {

    border-top-color: #9b9b9b;

    border-bottom-color: #9b9b9b;

}



/* mobile version */

.navbar-default .navbar-toggle {

    border-color: #c2c2c2;

}

.navbar-default .navbar-toggle:hover,

.navbar-default .navbar-toggle:focus {

    background-color: #c2c2c2;

}

.navbar-default .navbar-toggle .icon-bar {

    background-color: #fff;

}

@media (max-width: 767px) {

    .navbar-default .navbar-nav .open .dropdown-menu > li > a {

        color: #fff;

    }

    .navbar-default .navbar-nav .open .dropdown-menu > li > a:hover,

    .navbar-default .navbar-nav .open .dropdown-menu > li > a:focus {

        color: #fce9a7;

    }

}







.nav.nav-tabs > li.dropdown.active.open > a, 

.nav.nav-tabs > li.dropdown.active.open > ul.dropdown-menu a:hover,

.nav.nav-tabs > li.dropdown.open > a, 

.nav.nav-tabs > li.dropdown.open > ul.dropdown-menu a:hover

